    id }) {
  const [show , setshow] = useState(false) ;
 const [getoneIncome] = useGlobalContext()
  useEffect(()=>{
    getoneIncome(id)
  })
return(
    <>

 <button onClick={()=>{setshow(!show)}}></button>
 
    </>
)


